  return (
    <nav style={{
      background: "#1976d2",
      color: "white",
      padding: "10px 20px",
      display: "flex",
      justifyContent: "space-between",
      alignItems: "center",
      borderRadius: "8px",
      marginBottom: "20px"
    }}>
      <h2>Inventory Management</h2>
      <div>
        <a href="#products" style={{ color: "white", marginRight: "15px", textDecoration: "none" }}>Products</a>
        <a href="#locations" style={{ color: "white", marginRight: "15px", textDecoration: "none" }}>Locations</a>
        <a href="#movements" style={{ color: "white", textDecoration: "none" }}>Movements</a>
      </div>
    </nav>
  );
}
